import './ServiceCard.css';
import Logo from './profession.png';
import React from "react";


// const database =[
//     'Service 1',
//     'Service 2',
//     'Service 3',
//     'Service 4',
//     'Service 5',
//     'Service 6',
//     'Service 7',
//     'Service 8',
//     'Service 9'
// ]

const database2 = [
    {
        title: 'Консультация',
        content: 'Описание консультации',
        logo: Logo,
        price: 1999
    },
    {
        title: 'СОставление резюме',
        content: 'Описание услуги по составлению резюме',
        logo: Logo,
        price: 2999
    },
]

function CardPiece(props) {
    return (
            <div className="card center">
                <div className="front">
                    <img className={"profLogo"} src ={props.logo} alt=" "/>
                </div>
                <div className="back">
                    <div className="back-content center">
                        <h2>{props.title}</h2>
                        <span>{props.content}</span>
                        <span>{props.price}</span>
                    </div>
                </div>
            </div>
    );
}
function ServiceCard () {
    return (
    <div className="serviceContainer">
        {database2.map((serviceName) => {
            return (<CardPiece title={serviceName.title} content={serviceName.content} logo={serviceName.logo} price={serviceName.price}/>)
        })}

    </div>
    );
}


export default ServiceCard;
